window.bookSummaryJSON = "<p><i>Spicy enemies to lovers fantasy romance with an HEA.</i><br> <br> <b>TEMPT THE COURT JESTER, AND HE'LL RUIN YOU.</b><br> <br> I became the obsession of the most wicked man at court. I'd refused to follow the jester's devious rules, but from the moment his seductive touch heated my veins, he took my soul captive, and the good little princess became a royal outcast.<br> <br> Now I'm his to worship, and he's mine to rule. Instead of burning out, the passionate fire between us only blazes hotter.<br> <br> But while forbidden desire binds us together, kingdoms seek to tear us apart. A corrupt king threatens my claim to the throne. A cruel prince offers us a vicious bargain. And new traitors lurk in the shadows of our court.<br> <br> Amid dark secrets, I must play a deadly game and risk more than ever. Not only my crown, but also my heart.<br> <br> Contains mature themes.</p>"; 
